import React, { useEffect, useState } from 'react';


function App() {
    const [data, setData]= useState([])
    useEffect(()=>{
        fetch('http://localhost:8081/plantdetails')
        .then(res => res.json())
        .then(data =>console.log(data))
        .catch(err => console.log(err));
    },[])

  return (
    <div>
        <h1 className="text-3xl font-bold underline">
      Hello world!
    </h1>
    </div>
  )
}

export default App;
